import numpy as np
import h5py
import sys
import os

sys.path.append(os.path.join(os.pardir, 'hymd'))
from file_io import distribute_input  # noqa: E402
from input_parser import Config  # noqa: E402


def make_arrays():
    np.set_printoptions(threshold=sys.maxsize, precision=16)
    config = Config(n_steps=1, time_step=0.03, mesh_size=[30, 30, 30],
                    box_size=np.array([13.0, 13.0, 14.0]), sigma=0.5, kappa=1)

    with h5py.File('../RUN/dppc.h5', 'r') as in_file:
        rank_range, molecules_flag = distribute_input(
            in_file, 0, 1, config.n_particles,
            config.max_molecule_size if config.max_molecule_size else 201
        )
        indices = in_file['indices'][rank_range]
        positions = in_file['coordinates'][-1, rank_range, :]
        names = in_file['names'][rank_range]

        types = None
        if 'types' in in_file:
            types = in_file['types'][rank_range]
        if molecules_flag:
            molecules = in_file['molecules'][rank_range]
            bonds = in_file['bonds'][rank_range]

    last_ind = 6336
    if False:
        for arr in (indices, names, types, molecules):
            print('arr = np.array([', end='')
            for i, ind in enumerate(arr[:last_ind]):
                if np.mod(i, 7000) == 0 and i != 0:
                    print('\n                    ', end='')
                print(f'{ind}, ', end='')
            print('])')

    if False:
        for arr in (bonds, positions):
            print('arr = np.array([', end='')
            for i, ind in enumerate(arr[:last_ind]):
                if np.mod(i, 7000) == 0 and i != 0:
                    print('\n                    ', end='')

                print('[', end='')
                for j, b in enumerate(ind):
                    if j == 0:
                        print(f'{b}', end='')
                    else:
                        print(f', {b}', end='')
                print('], ', end='')
            print('])')


